export const getStaticProps = wrapper.getStaticProps(async ({ store }) => {
    store.dispatch(fetchCategories('ru'));
    // return {
    //     namespacesRequired: ['main', 'common'],
    // }
})

export default withTranslation(['main', 'common'])(HomePage);
